import React from "react";
// import { 
	 
	// Route, Routes, 
	// Link } from "react-router-dom";


    export default function MainCarousel () {
        return(
            <div className="row">
			<div className="col-md-12">
				<div className="camera_wrap pattern_4 camera_emboss" id="camera_wrap_4">
					<div data-src="img/demo/slide1.jpg">
						<div className="camera_caption fadeFromTop">
							<h1>MultiPurpose Responsive Template</h1>
							<span>
							Professional & modern website template created for you and your business prosperity. Build a top-notch business website in no time! 
							</span>
						</div>
					</div>
					<div data-src="img/demo/slide2.jpg">
						<div className="camera_caption fadeFromRight">
							<h1>Professional Design & Elegant Code</h1>
							<span>
							Beautiful behind the scenes too! Biscaya Template comes with top notch customer support to help you get your business online fast. 
							</span>
						</div>
					</div>
				</div>			
				<div className="text-center">
					<img src="img/sha.png" className="slidershadowcam" alt=""/>
				</div>
			</div>			
		</div>
            )
    }
